import React from "react";

function Nav() {
  return (
    <header>
      <div className="nav">
        <div className="item1">
          <p className="box-1">One</p>
        </div>
        <div className="item1">
          <p>Two</p>
        </div>
        <div className="item1">
          <p>Three</p>
        </div>
      </div>
    </header>
  );
}

export default Nav;
